function CheckoutPage() {
    return ( 
        <div className=" w-screen h-11/12 flex flex-col py-16"
                style={{backgroundColor :'#e5e7eb'}}>
            <div className="bg-white rounded-lg h-14 w-full mx-9">
                <div className="w-full text-center font-semibold flex justify-center">
                        My Shopping Cart
                </div>
            </div>
        </div>
     );
}

export default CheckoutPage;
